select to_timestamp, value
from (
  select to_timestamp(time_bucket::text, 'YYYYMMDDHH24MI'), value
  from service_instance_cpm
) t
where to_timestamp < (now() - interval '1 minute')

select to_timestamp, value
from (
  select to_timestamp(time_bucket::text, 'YYYYMMDDHH24MI'), percentage / 100 "value"
  from service_instance_sla
) t
where to_timestamp < (now() - interval '1 minute')

